						<div itemprop="articleBody">
		<p style="text-align: left;">Generalforsamlingen efterfølges af årsmødet.</p>
<p style="text-align: left;">Program:</p>
<p>1. Valg af dirigent</p>
<p>2. Mundtlig beretning ved formanden</p>
<p>3. Godkendelse af revideret regnskab for 2012-13</p>
<p>4. Fastlæggelse af kontingent</p>
<p>5. Forslag fra medlemmer</p>
<p>6. Valg til bestyrelsen. Margit Niebuhr og Galina Semenisina er på valg. Da Margit Niebuhr&nbsp;har påtaget sig ansvaret for at arrangere Den Nordeuropæiske Regions Kongres for IMWA vil bestyrelsen foreslå genvalg. Alle tre suppleanter er på valg. Bestyrelsen vil konstituere sig med et medlem/suppleant som kasserer</p>
<p>7. Valg af revisorer. Birgit Albrechtsen og Birgitte Kobberbøl-Jensen er villige til genvalg.</p>
<p>8. Eventuelt.</p>
<p>På bestyrelsens vegne</p>
<p>Birte Holm Sørensen</p>	</div>

	
